import Home from "./Home";
import About from "./About";
import Gallery from "./Gallery";
import Contact from "./Contact";

import {Fragment,StrictMode} from "react"
import ReactDom from "react-dom"





class App extends React.Component{
    render(){
        return(
            <>
           <h1>Home</h1>
           <Home/>
           <About/>
           <Gallery/>
 <Contact/>
           </>
        )
    }
}
export default App
